BEGIN TRANSACTION;
CREATE TABLE AgenteCausalCatalogo (Id INTEGER PRIMARY KEY, Diagnostico INTEGER, Agente TEXT);
CREATE TABLE Arbol (AnioProduccion TEXT, ModificadoProduccion TEXT, Modificado TEXT, IdTemporal INTEGER PRIMARY KEY, Mensaje TEXT, Placa TEXT, IdUltimaRevision TEXT, Estatus TEXT, Replantado NUMERIC, Vivero TEXT, ProduccionEstimada NUMERIC, Notas TEXT, InjertadoFuerte TEXT, NumeroEstacion TEXT, FechaPlantacion TEXT, Variedad TEXT, Tipo TEXT, Elevacion TEXT, Longitud TEXT, Latitud TEXT, QR TEXT, ClaveUnica TEXT, UbicacionColumna TEXT, UbicacionFila TEXT, IdHuerta TEXT, Arbol TEXT, Id TEXT);
